import axios from "axios";

const api = axios.create({
  baseURL: "http://localhost:9000/api", // Backend URL
  headers: {
    "Content-Type": "application/json",
  },
});

// Optional: Add interceptors for auth if needed
// api.interceptors.request.use(config => { ... });

export default api;
